column1:
@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:protoplanet rdfs:label "protoplanet" ;
    rdfs:subClassOf :astronomical_body ;
    :has_definition "An astronomical object that forms within a protoplanetary disc when planetesimals and other solid debris aggregate and, due to gravitational forces,  fuse and initiate internal melting to produce a differentiated interior." ;
    :has_exact_synonym "planetary embryo" .

:astronomical_body rdfs:label "astronomical body" .

,"A protoplanet, also known as a planetary embryo, is a subclass of astronomical bodies. It is defined as an astronomical object that forms within a protoplanetary disc when planetesimals and other solid debris aggregate. Due to gravitational forces, these elements fuse and initiate internal melting to produce a differentiated interior."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:protoplanetary_disk rdfs:label "protoplanetary disk" ;
    rdfs:subClassOf [ owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :gaseous_environmental_material ;
                            rdf:rest [ rdf:first [ owl:onProperty :has_quality ;
                                            owl:someValuesFrom :dense ] ] ] ] ],
        :astronomical_object ;
    owl:equivalentClass [ owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :gaseous_environmental_material ;
                            rdf:rest [ rdf:first [ owl:onProperty :has_quality ;
                                            owl:someValuesFrom :dense ] ] ] ] ] ;
    :has_definition "An astronomical object which is composed of dense gas and dust rotating around a young newly formed star, a T Tauri star, or a Herbig Ae/Be star in a disk-shaped configuration." .

:astronomical_object rdfs:label "astronomical object" .

:dense rdfs:label "dense" .

:gaseous_environmental_material rdfs:label "gaseous environmental material" .

:has_part rdfs:label "has part" .

:has_quality rdfs:label "has quality" .

,"A protoplanetary disk, which falls under the category of astronomical objects, possesses elements that follow the concept of 'has part' properties. This indicates that parts of the disk share characteristics with the broader concept of a 'gaseous environmental material'. Additionally, this disk features qualities that align with the description of being 'dense'. From another perspective, the protoplanetary disk is also considered a subclass of a quantifiable entity represented by 'has part'. In the same context, some components of this disk correspond with the description of 'gaseous environmental material'. As a subclass, the protoplanetary disk carries similar dense properties.  To clarify further, a protoplanetary disk is defined as an astronomical object composed of dense gas and dust. It is found rotating around a young, newly formed star, a T Tauri star, or a Herbig Ae/Be star in a disk-shaped configuration."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:proplyd rdfs:label "proplyd" ;
    rdfs:subClassOf [ owl:onProperty :participates_in ;
            owl:someValuesFrom :photoevaporation ],
        :protoplanetary_disk ;
    owl:equivalentClass [ owl:onProperty :participates_in ;
            owl:someValuesFrom :photoevaporation ] ;
    :has_definition "A protoplanetary disk which is externally illuminated and undergoing photoevaporation." ;
    :has_exact_synonym "ionized protoplanetary disk" .

:protoplanetary_disk rdfs:label "protoplanetary disk" .

:participates_in rdfs:label "participates in" .

:photoevaporation rdfs:label "photoevaporation" .

,"A proplyd, or an ionized protoplanetary disk, is essentially a protoplanetary disk that is externally illuminated and undergoing a process known as photoevaporation. The term 'proplyd' shares the robust concept of participation in photoevaporation, implying that it actively partakes in this process. Both 'proplyd' and 'photoevaporation' are interconnected, orchestrating a symbiotic relationship in which the proplyd is not only a subclass of a protoplanetary disk but also encompasses this property of engaging in photoevaporation. Notably, the proplyd doesn't just participate in photoevaporation, but the disk attains specific values from the very process it is engaged in, further cementing the connection between them."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mesoplanet rdfs:label "mesoplanet" ;
    rdfs:subClassOf :planet ;
    :has_definition "A planet which is smaller than Mercury but larger than Ceres." .

:planet rdfs:label "planet" .

,A mesoplanet is a subclass of a planet. The definition of a mesoplanet denotes it as a planet that is smaller than Mercury but larger than Ceres.

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:circumbinary_planet rdfs:label "circumbinary planet" ;
    rdfs:subClassOf :planet ;
    :has_definition "A planet which orbits two stars." .

:planet rdfs:label "planet" .

,A circumbinary planet is a subclass of a planet. It is defined as a planet which orbits two stars.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:volatile_astrogeological_material rdfs:label "volatile astrogeological material" ;
    rdfs:subClassOf [ owl:onProperty :part_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :atmosphere ;
                            rdf:rest [ rdf:first :planetary_crust ] ] ] ],
        :environmental_material ;
    :has_definition "A material which is composed primarily of chemical elements and compounds with relatively low boiling points, equilibrium condensation temperatures below 1300 Kelvin, and which are part of the crust or atmosphere of a moon or planet." ;
    :has_related_synonym "volatile" .

:atmosphere rdfs:label "atmosphere" .

:environmental_material rdfs:label "environmental material" .

:part_of rdfs:label "part of" .

:planetary_crust rdfs:label "planetary crust" .

,"Volatile astrogeological material is a subclass of environmental material. This specific material is part of the broader category due to its inherent properties. Furthermore, the volatile astrogeological material is a union of the elements in the atmosphere and the planetary crust. This is based on some values drawn from these elements, which categorize it as part of these planetary elements. By definition, a volatile astrogeological material is primarily composed of chemical elements and compounds with relatively low boiling points. These compounds have equilibrium condensation temperatures below 1300 Kelvin, and they form part of the crust or atmosphere of a moon or planet. Furthermore, this type of environmental material is synonymously referred to as 'volatile'."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:astrogeological_gas rdfs:label "astrogeological gas" ;
    rdfs:subClassOf :volatile_astrogeological_material ;
    :has_definition "An astrogeological volatile which is composed primarily of chemical compounds with boiling points around those of hydrogen and helium." ;
    :has_related_synonym "gas" .

:volatile_astrogeological_material rdfs:label "volatile astrogeological material" .

,"Astrogeological gas is a subclass of volatile astrogeological material. It is defined as an astrogeological volatile which is composed primarily of chemical compounds with boiling points around those of hydrogen and helium. Additionally, ""gas"" is a related synonym to astrogeological gas."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:refractory_astrogeological_material rdfs:label "refractory astrogeological material" ;
    rdfs:subClassOf :environmental_material ;
    :has_definition "A material which is composed primarily of chemical elements and compounds which have equilibrium condensation temperatures above approximately 1300 Kelvin and which are part of the crust or atmosphere of a moon or planet." ;
    :has_related_synonym "refractory material" .

:environmental_material rdfs:label "environmental material" .

,"Refractory astrogeological material is a sub-category of environmental material. This refers to a material primarily composed of chemical elements and compounds, which have equilibrium condensation temperatures above approximately 1300 Kelvin. This substance is a part of the crust or the atmosphere of a moon or a planet. Also, refractory astrogeological material can be interchangeably referred to as a refractory material."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atmospheric_escape rdfs:label "atmospheric escape" ;
    rdfs:subClassOf [ owl:onProperty :has_participant ;
            owl:someValuesFrom :gaseous_environmental_material ],
        [ owl:onProperty :has_output ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :gaseous_environmental_material ;
                            rdf:rest [ rdf:first [ owl:onProperty :located_in ;
                                            owl:someValuesFrom :outer_space ] ] ] ] ],
        [ owl:onProperty :has_part ;
            owl:someValuesFrom :electromagnetic_radiation ],
        [ owl:onProperty :has_input ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :gaseous_environmental_material ;
                            rdf:rest [ rdf:first [ owl:onProperty :part_of ;
                                            owl:someValuesFrom :planetary_atmosphere ] ] ] ] ],
        :material_transport_process ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :material_transport_process ;
                    rdf:rest [ rdf:first [ owl:onProperty :has_input ;
                                    owl:someValuesFrom [ owl:intersectionOf [ ] ] ] ;
                            rdf:rest [ rdf:first [ owl:onProperty :has_output ;
                                            owl:someValuesFrom [ ] ] ] ] ] ] ;
    :has_definition "A process during which gases that constitute a planetary atmosphere escape that planet's gravitational field and move away into outer space." .

:electromagnetic_radiation rdfs:label "electromagnetic radiation" .

:has_part rdfs:label "has part" .

:has_participant rdfs:label "has participant" .

:located_in rdfs:label "located in" .

:outer_space rdfs:label "outer space" .

:part_of rdfs:label "part of" .

:planetary_atmosphere rdfs:label "planetary atmosphere" .

:has_input rdfs:label "has input" .

:has_output rdfs:label "has output" .

:material_transport_process rdfs:label "material transport process" .

:gaseous_environmental_material rdfs:label "gaseous environmental material" .

,"Atmospheric escape is a concept akin to and intersects with the material transport process. As a subclass of the material transport process, it exhibits characteristics shared with electromagnetic radiation and gaseous environmental material. The atmospheric escape process consists of parts, inputs, and outputs.

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hydrodynamic_escape rdfs:label "hydrodynamic escape" ;
    rdfs:subClassOf :atmospheric_escape ;
    :has_definition "An atmospheric escape process during which atoms that are parts of a planetary atmosphere escape into outer space through numerous collisions with lighter atoms in that atmosphere." .

:atmospheric_escape rdfs:label "atmospheric escape" .

,Hydrodynamic escape is a sub class of atmospheric escape. It is defined as an atmospheric escape process during which atoms that are parts of a planetary atmosphere escape into outer space through numerous collisions with lighter atoms in that atmosphere.

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cirrus_homogenitus_cloud rdfs:label "cirrus homogenitus cloud" ;
    rdfs:subClassOf :cirrus_cloud,
        :homogenitus_cloud ;
    :has_definition "A cloud which is cirriform and is formed by condensation events centred on an aircraft's contrail." .

:cirrus_cloud rdfs:label "cirrus cloud" .

:homogenitus_cloud rdfs:label "homogenitus cloud" .

,The cirrus homogenitus cloud is a sub-class of both the cirrus cloud and the homogenitus cloud. It is specifically defined as a cirriform cloud that is formed by condensation events centered on an aircraft's contrail.

@prefix : <https://zaitoun.dev/onto/> .
@prefix dc: <http://purl.org/dc/elements/1.1/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cirrus_cloud rdfs:label "cirrus cloud" ;
    dc:contributor <https://orcid.org/0000-0002-2996-719X> ;
    rdfs:subClassOf [ owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :object_aggregate ;
                            rdf:rest [ rdf:first [ owl:onProperty :has_member ;
                                            owl:someValuesFrom :water_ice_crystal ] ] ] ] ],
        [ owl:onProperty :part_of ;
            owl:someValuesFrom :high_atmospheric_level ],
        [ owl:onProperty :has_quality ;
            owl:someValuesFrom :filamentous ],
        :ice_mass,
        :water_based_cloud ;
    :has_definition "A cloud which 1) has been shaped into detached fibrous filaments, 2) is almost exclusively composed of ice crystals, 3) is located in the high level of the atmosphere (high étage)."@en ;
    :has_exact_synonym "(Eis)-Federwolke"@de,
        "Cirruswolke"@de,
        "Zirruswolke"@de .

:composed_primarily_of rdfs:label "composed primarily of" .

:filamentous rdfs:label "filamentous" .

:has_member rdfs:label "has member" .

:has_quality rdfs:label "has quality" .

:high_atmospheric_level rdfs:label "high atmospheric level" .

:ice_mass rdfs:label "ice mass" .

:object_aggregate rdfs:label "object aggregate" .

:part_of rdfs:label "part of" .

:water_based_cloud rdfs:label "water-based cloud" .

:water_ice_crystal rdfs:label "water ice crystal" .

,"Cirrus cloud is a subclass of ice mass and also of water-based cloud. It exhibits a specific property that it is part of the high atmospheric level and possesses the quality of being filamentous. Apart from being a part of high atmospheric level, Cirrus cloud is primarily composed of an aggregate object that includes water ice crystal as its member.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:obsolete_newcloud rdfs:label "obsolete newCloud" ;
    owl:deprecated true ;
    :has_definition "OBSOLETE A cloud which" .

,"The term ""obsolete newCloud"" is defined as ""OBSOLETE A cloud which"". This term is now considered deprecated and its status is set to true."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iucn_strict_nature_reserve rdfs:label "IUCN strict nature reserve" ;
    rdfs:subClassOf :area_protected_according_to_iucn_guidelines ;
    :has_broad_synonym "strict nature reserve" ;
    :has_definition "An IUCN protected area in which human visitation, use and impacts are strictly controlled and limited to ensure protection and conservation of natural biodiversity and/or geodiversity, natural ecosystem assemblages and processes, and any associated cultural and spiritual values." .

:area_protected_according_to_iucn_guidelines rdfs:label "area protected according to IUCN guidelines" .

,"An IUCN strict nature reserve is a subclass of areas that are protected according to the IUCN guidelines. This protected area is defined as a region where human visitation, use, and impacts are strictly controlled and limited. This rigorous management system is maintained to ensure the protection and conservation of natural biodiversity and/or geodiversity, natural ecosystem assemblages, processes, and any associated cultural and spiritual values . In a broader context, the IUCN strict nature reserve is also referred to as a 'strict nature reserve'."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iucn_wilderness_area rdfs:label "IUCN wilderness area" ;
    rdfs:subClassOf [ owl:onProperty :overlaps ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_surface ;
                            rdf:rest [ rdf:first [ owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom :natural_environment ] ] ] ] ],
        :area_protected_according_to_iucn_guidelines ;
    :has_definition "An IUCN protected area which 1) is dominated by natural ecosystems, 2) is sufficiently large to allow those ecosystems to function and develop without local anthropogenic perturbation, 3) is  managed to prevent perturbations by proximate or local anthropisation, including those caused by local and/or indigenous human communities or human visitation." ;
    :has_exact_synonym "wilderness area" .

:area_protected_according_to_iucn_guidelines rdfs:label "area protected according to IUCN guidelines" .

:composed_primarily_of rdfs:label "composed primarily of" .

:natural_environment rdfs:label "natural environment" .

:overlaps rdfs:label "overlaps" .

:planetary_surface rdfs:label "planetary surface" .

,"The IUCN wilderness area is a subclass of the area protected according to IUCN guidelines. It is defined as an IUCN protected area which 1) is dominated by natural ecosystems, 2) is sufficiently large to allow those ecosystems to function and develop without local anthropogenic perturbation, 3) is managed to prevent perturbations by proximate or local anthropisation, including those caused by local and/or indigenous human communities or human visitation. This area is also exactly synonymous with the wilderness area. Furthermore, this IUCN wilderness area has a property overlap and possesses certain values from intersections with the planetary surface. Additionally, it is primarily composed of certain values from an intersection with the natural environment."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:geodiversity rdfs:label "geodiversity" ;
    rdfs:subClassOf :physical_object_quality ;
    :has_definition "A quality which inheres in a astronomical body or astronomical body part by virtue of the variation in its material composition, participation in geological processes, and the variation in is land- and hydroforms." .

:physical_object_quality rdfs:label "physical object quality" .

,"Geodiversity is a sub-class of physical object quality. It is defined as a quality that adheres to an astronomical body or part thereof, owing to the variation in its material composition, involvement in geological processes, as well as the variation in its land- and hydroforms."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iucn_natural_monument_or_feature rdfs:label "IUCN natural monument or feature" ;
    rdfs:subClassOf [ owl:onProperty :overlaps ;
            owl:someValuesFrom :natural_monument ],
        :area_protected_according_to_iucn_guidelines ;
    :has_definition "An IUCN protected area which includes a primarily natural formation designated to be of high natural heritage value and the environmental systems which it determines (e.g. the spray zone of a waterfall monument)." ;
    :has_related_synonym "natural monument" .

:area_protected_according_to_iucn_guidelines rdfs:label "area protected according to IUCN guidelines" .

:natural_monument rdfs:label "natural monument" .

:overlaps rdfs:label "overlaps" .

,"The IUCN natural monument or feature is a subclass of the area that's protected according to IUCN guidelines. It specifically overlaps with certain properties and also shares some values from the natural monument. In addition, the IUCN natural monument or feature is defined as an IUCN protected area which includes a primarily natural formation that's designated to be of high natural heritage value, including the environmental systems it influences. For instance, this might be the spray zone of a waterfall monument. This IUCN category also shares a related synonym with the term 'natural monument'."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iucn_habitat_species_management_area rdfs:label "IUCN habitat/species management area" ;
    rdfs:subClassOf :area_protected_according_to_iucn_guidelines ;
    :has_broad_synonym "habitat management area" ;
    :has_definition "An IUCN protected area within which the habitats of or ecosystems used by floral and faunal species deemed to be of international, national, or local importance are maintained, conserved, or restored such that their composition and functional integrity are maintained." ;
    :has_related_synonym "species management area" .

:area_protected_according_to_iucn_guidelines rdfs:label "area protected according to IUCN guidelines" .

,"The IUCN habitat/species management area is a subclass of areas that are protected according to IUCN guidelines. This means that it's a type of area specifically designated for preservation as per guidelines set by the International Union for Conservation of Nature (IUCN). The IUCN habitat/species management area is defined as a protected area within which the habitats or ecosystems used by floral and faunal species, deemed to be of international, national, or local importance, are maintained, conserved, or restored. This ensures that their composition and functional integrity are kept intact. In terms of synonyms, the term ""IUCN habitat/species management area"" is often broadly referred to as 'habitat management area'. It also has a more closely related synonym, 'species management area'."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ecosystem_fragment rdfs:label "ecosystem fragment" ;
    rdfs:subClassOf [ owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :ecosystem_fragmentation_process ],
        :ecosystem ;
    :has_definition "An ecosystem which has been causally isolated from a larger ecosystem within which it was previously embedded, such that the direct exchange of materials, resources, and energy between these systems is severely or entirely curtailed." .

:ecosystem rdfs:label "ecosystem" .

:ecosystem_fragmentation_process rdfs:label "ecosystem fragmentation process" .

:formed_as_result_of rdfs:label "formed as result of" .

,"An ecosystem fragment is a subclass of an ecosystem. This fragment is formed as a result of an ecosystem fragmentation process, which is an inherent property of the ecosystem fragment. Furthermore, the definition of an ecosystem fragment is an ecosystem that has been causally isolated from a larger ecosystem within which it was previously embedded, such that the direct exchange of materials, resources, and energy between these systems is significantly or entirely curtailed."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ecosystem_fragmentation_process rdfs:label "ecosystem fragmentation process" ;
    rdfs:subClassOf [ owl:onProperty :has_input ;
            owl:someValuesFrom :ecosystem ],
        [ owl:onProperty :causally_upstream_of_or_within ;
            owl:someValuesFrom :ecosystem_decay ],
        [ owl:onProperty :results_in_formation_of ;
            owl:someValuesFrom :ecosystem_fragment ],
        :biological_process,
        :ecosystem_process ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :ecosystem_process ;
                    rdf:rest [ rdf:first [ owl:onProperty :has_input ;
                                    owl:someValuesFrom :ecosystem ] ;
                            rdf:rest [ rdf:first [ owl:onProperty :results_in_formation_of ;
                                            owl:someValuesFrom :ecosystem_fragment ] ] ] ] ] ;
    :has_definition "A process during which one or more parts of an ecosystem become causally isolated such that the direct flow or exchange of materials, resources, and energy between a given fragment and the remainder of the original system is severely curtailed or entirely halted." .

:biological_process rdfs:label "biological_process" .

:causally_upstream_of_or_within rdfs:label "causally upstream of or within" .

:ecosystem_decay rdfs:label "ecosystem decay" .

:ecosystem rdfs:label "ecosystem" .

:ecosystem_fragment rdfs:label "ecosystem fragment" .

:ecosystem_process rdfs:label "ecosystem process" .

:has_input rdfs:label "has input" .

:results_in_formation_of rdfs:label "results in formation of" .

,"The ecosystem fragmentation process is a concept that intersects with the ecosystem process. This process also intersects with 'has input' property and has some value from 'ecosystem.' Furthermore, this process has another intersection where it connects with the property 'results in formation of,' and from this intersection, some values from 'ecosystem fragment' are derived.

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_protected_according_to_iucn_guidelines rdfs:label "area protected according to IUCN guidelines" ;
    rdfs:subClassOf :area_of_protected_biodiversity ;
    :alternative_term "IUCN protected area"@en ;
    :has_definition "A protected area in which management objectives have been declared, by a local governing body or authority, to adhere to the guidelines set forth by the International Union for the Conservation of Nature (IUCN)." .

:area_of_protected_biodiversity rdfs:label "area of protected biodiversity" .

,The area protected according to IUCN guidelines falls under the subclass of area of protected biodiversity. It is defined as a protected area in which management objectives have been declared by a local governing body or authority to adhere to the guidelines set forth by the International Union for the Conservation of Nature (IUCN). This area is also alternatively referred to as the IUCN protected area.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:active_ecosystem_management_process rdfs:label "active ecosystem management process" ;
    rdfs:subClassOf [ owl:onProperty :has_participant ;
            owl:someValuesFrom :ecosystem ],
        :anthropogenic_environmental_process,
        :anthropogenic_modulatory_intervention_process ;
    :has_definition "A process during which an ecosystem, its parts, or the processes it participates in are modified by human intervention to accomplish an objective." ;
    :has_exact_synonym "ecosystem management" ;
    :has_related_synonym "environmental management",
        "Umweltmaßnahme"@de .

:anthropogenic_environmental_process rdfs:label "anthropogenic environmental process" .

:anthropogenic_modulatory_intervention_process rdfs:label "anthropogenic modulatory intervention process" .

:ecosystem rdfs:label "ecosystem" .

:has_participant rdfs:label "has participant" .

,"The active ecosystem management process is a subclass of both the anthropogenic modulatory intervention process and the anthropogenic environmental process. Furthermore, it has properties which consider the participation of specific participants. Among some values, the consideration specifically involves the ecosystem.

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:conservation_focused_active_ecosystem_management_process rdfs:label "conservation-focused active ecosystem management process" ;
    rdfs:subClassOf :active_ecosystem_management_process ;
    :has_definition "An active management process which has the conservation of an ecosystem, or a part thereof, as its primary objective." ;
    :has_related_synonym "conservation action",
        "conservation process",
        "nature conservation",
        "Umweltschutz"@de .

:active_ecosystem_management_process rdfs:label "active ecosystem management process" .

,"The conservation-focused active ecosystem management process is a subclass of the broader term active ecosystem management process. By definition, this process is an active management process with the primary objective being the conservation of an ecosystem, or part of it. It is known by several related synonyms, including ""Umweltschutz"", ""conservation action"", ""conservation process"", and ""nature conservation""."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iucn_protected_landscape_seascape rdfs:label "IUCN protected landscape/seascape" ;
    rdfs:subClassOf :area_protected_according_to_iucn_guidelines ;
    :has_definition "An IUCN protected area which 1) includes entities that have been deemed to be of high scenic quality, 2) is composed of a historically stable assemblage of causally interlinked natural and anthropised ecosystems that provides cultural ecosystem services, and 3) hosts traditional and sustainable human activities." .

:area_protected_according_to_iucn_guidelines rdfs:label "area protected according to IUCN guidelines" .

,"An IUCN protected Landscape/Seascape is a subclass of an area that is protected in accordance with IUCN guidelines. This specific classification refers to an IUCN protected area that meets several criteria: it includes entities of high scenic quality, composed of historically stable assemblages of naturally interlinked and anthropised ecosystems providing cultural ecosystem services, and it also hosts traditional and sustainable human activities."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sacred_site rdfs:label "sacred site" ;
    rdfs:subClassOf :site ;
    :has_definition "A site which is bounded or relativised by a material entity which is of spiritual significance to one or more human groups." .

:site rdfs:label "site" .

,"A sacred site is a sub-category of a site. By definition, a sacred site is a specific location, delimited by a physical entity that bears spiritual significance for one or more human groups."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ecosystem_decay rdfs:label "ecosystem decay" ;
    rdfs:subClassOf [ owl:onProperty :has_participant ;
            owl:someValuesFrom :ecosystem_fragment ],
        [ owl:onProperty :causally_downstream_of_or_within ;
            owl:someValuesFrom :ecosystem_fragmentation_process ],
        [ owl:onProperty :has_participant ;
            owl:someValuesFrom :habitat ],
        [ owl:onProperty :has_participant ;
            owl:someValuesFrom :ecological_community ],
        :ecosystem_process ;
    :has_definition "A process during which an ecosystem fragment loses its system integrity, with many of its resident ecological populations 1) losing their habitats, 2) undergoing a loss of functional and phylogenetic diversity, and 3) undergoing a subsequent genetic destabilisation through inbreeding." .

:causally_downstream_of_or_within rdfs:label "causally downstream of or within" .

:ecological_community rdfs:label "ecological community" .

:ecosystem_fragment rdfs:label "ecosystem fragment" .

:ecosystem_fragmentation_process rdfs:label "ecosystem fragmentation process" .

:ecosystem_process rdfs:label "ecosystem process" .

:habitat rdfs:label "habitat" .

:has_participant rdfs:label "has participant" .

,"Ecosystem decay is a subclass of ecosystem process. Ecosystem decay is a process during which an ecosystem fragment loses its system integrity, with many of its resident ecological populations undergoing a loss of habitats, experiencing a loss of functional and phylogenetic diversity, and suffering a subsequent genetic destabilisation through inbreeding.

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:habitat_fragmentation_process rdfs:label "habitat fragmentation process" ;
    rdfs:subClassOf :ecosystem_fragmentation_process ;
    :has_definition "An ecosystem fragmentation process during which discontinuities emerge in the habitats of one or more ecological populations." .

:ecosystem_fragmentation_process rdfs:label "ecosystem fragmentation process" .

,The habitat fragmentation process is a subclass of the ecosystem fragmentation process. It is defined as an ecosystem fragmentation process during which discontinuities emerge in the habitats of one or more ecological populations.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:environment_associated_with_an_aquatic_invertebrate rdfs:label "environment associated with an aquatic invertebrate" ;
    rdfs:subClassOf [ owl:onProperty :determined_by ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first [ owl:intersectionOf [ rdf:first :metazoa ;
                                            rdf:rest [ ] ] ] ;
                            rdf:rest [ rdf:first [ owl:onProperty :has_habitat ;
                                            owl:someValuesFrom [ ] ] ] ] ] ],
        :animal_associated_environment ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :ecosystem ;
                    rdf:rest [ rdf:first [ owl:onProperty :determined_by ;
                                    owl:someValuesFrom [ owl:intersectionOf [ ] ] ] ] ] ] ;
    :has_definition "An environment which has its properties and composition largely determined by the presence of a metazoan which lacks a vetebral column and which has a habitat that is found in an aquatic environmental system." .

:animal_associated_environment rdfs:label "animal-associated environment" .

:ecosystem rdfs:label "ecosystem" .

:has_habitat rdfs:label "has habitat" .

:metazoa rdfs:label "Metazoa" .

:determined_by rdfs:label "determined by" .

,"The environment associated with an aquatic invertebrate is conceptualized as a part of an ecosystem. This environment is largely determined by specific properties. Furthermore, this environment is a subcategory of an animal-associated environment which is further determined by certain properties.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arable_land rdfs:label "arable land" ;
    rdfs:subClassOf [ owl:onProperty :has_quality ;
            owl:someValuesFrom :arable ],
        :land ;
    :has_definition "Land which is regularly manipulated by human activities, such as plowing or tilling, in order to grow crops." .

:arable rdfs:label "arable" .

:has_quality rdfs:label "has quality" .

:land rdfs:label "land" .

,"Arable land is a subclass of land, which is regularly manipulated by human activities, such as plowing or tilling, in order to grow crops. Moreover, as a subclass of land, arable land also has certain qualities and some values from the category of arable."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pasturable_land rdfs:label "pasturable land" ;
    rdfs:subClassOf :land ;
    :has_definition "Land which hosts a community of herbaceous plants - such as grasses and forbs - upon which animals may graze." .

:land rdfs:label "land" .

,"Pasturable land is a sub-class of land. It is defined as a land that hosts a community of herbaceous plants, such as grasses and forbs, upon which animals may graze."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cnidarian_associated_environment rdfs:label "cnidarian-associated environment" ;
    rdfs:subClassOf [ owl:onProperty :determined_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :cnidaria ;
                            rdf:rest [ rdf:first [ owl:onProperty :part_of ;
                                            owl:someValuesFrom :cnidaria ] ] ] ] ],
        :animal_associated_environment ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :animal_associated_environment ;
                    rdf:rest [ rdf:first [ owl:onProperty :determined_by ;
                                    owl:someValuesFrom [ owl:unionOf [ ] ] ] ] ] ] ;
    :has_definition "An environmental system determined by a cnidarian or part of a cnidarian." .

:part_of rdfs:label "part of" .

:animal_associated_environment rdfs:label "animal-associated environment" .

:cnidaria rdfs:label "Cnidaria" .

:determined_by rdfs:label "determined by" .

,"The cnidarian-associated environment is analogous to and intersects with the animal-associated environment. Further, the properties determining the cnidarian-associated environment is also associated with this intersection. The cnidarian-associated environment comes under the broader category of animal-associated environment and depends on specific attributes.

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bondon_cheese_environment rdfs:label "Bondon cheese environment" ;
    rdfs:subClassOf :environmental_system ;
    :has_definition "An environment which has its properties and composition determined by a portion of Bondon cheese." .

:environmental_system rdfs:label "environmental system" .

,"The Bondon cheese environment is a subclass of the environmental system. This environment has a specific definition - It is characterized by its properties and composition, which are influenced by a portion of Bondon cheese."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rhizoplane rdfs:label "rhizoplane" ;
    rdfs:subClassOf [ owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :plant_matter ],
        [ owl:onProperty :located_in ;
            owl:someValuesFrom :rhizosphere ],
        :solid_surface_layer ;
    :has_definition "A surface layer which is composed of the external surface of a root, together with closely adhering soil particles and debris" .

:composed_primarily_of rdfs:label "composed primarily of" .

:located_in rdfs:label "located in" .

:plant_matter rdfs:label "plant matter" .

:rhizosphere rdfs:label "rhizosphere" .

:solid_surface_layer rdfs:label "solid surface layer" .

,"Rhizoplane is a sub-class of a solid surface layer. It specifically resides in a particular location, which is identified as the rhizosphere according to some values. The primary composition of the rhizoplane class is derived from plant matter. Furthermore, rhizoplane is defined as a surface layer composed of the external surface of a root, merged with closely adhering soil particles and debris."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tended_pasturable_land rdfs:label "tended pasturable land" ;
    rdfs:subClassOf :pasturable_land ;
    :has_definition "Pasturable land which is maintained by human activities in order to provide grazing oppoturnities for livestock." .

:pasturable_land rdfs:label "pasturable land" .

,Tended pasturable land is a sub-category of pasturable land. It is defined as pasturable land which is maintained by human activities with the aim to provide grazing opportunities for livestock.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arable_or_pasturable_land rdfs:label "arable or pasturable land" ;
    rdfs:subClassOf [ owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :arable_land ;
                            rdf:rest [ rdf:first :pasturable_land ] ] ] ],
        :land ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :land ;
                    rdf:rest [ rdf:first [ owl:onProperty :has_part ;
                                    owl:someValuesFrom [ owl:unionOf [ ] ] ] ] ] ] ;
    :has_definition "Land which either hosts plant communities upon which animals may graze has been manipulated by tilling, ploughing, or other human activity for the purposes of seed sowing or planting crops." .

:arable_land rdfs:label "arable land" .

:pasturable_land rdfs:label "pasturable land" .

:has_part rdfs:label "has part" .

:land rdfs:label "land" .

,"Arable or pasturable land shares the same concept as the intersection of land. It also has a part as its property, which is similarly considered as the same concept as it intersects with the land. Furthermore, arable or pasturable land is a subclass of land and has the property of having parts. It is also defined as the subclass with some values derived from the union of both arable and pasturable land. It is important to mention that the land could either serve as a hosting spot for plant communities upon which animals may graze or it could have been manipulated by activities like tilling, ploughing, or other human operations for seeding or planting crops."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arable rdfs:label "arable" ;
    rdfs:subClassOf :environmental_condition ;
    :has_definition "A quality inhereing in a bearer by virtue of the bearer being periodically and mechanically manipulated to loosen and mix any soil which it has as a part." .

:environmental_condition rdfs:label "environmental condition" .

,"Arable is a sub-class of the environmental condition. The term ""arable"" is defined as a quality inherent in a bearer by virtue of the bearer being periodically and mechanically manipulated to loosen and mix any soil which it has as a part."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acidic_soil rdfs:label "acidic soil" ;
    rdfs:subClassOf [ owl:onProperty :has_quality ;
            owl:someValuesFrom :acidic ],
        :soil ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :soil ;
                    rdf:rest [ rdf:first [ owl:onProperty :has_quality ;
                                    owl:someValuesFrom :acidic ] ] ] ] ;
    :has_definition "Soil which has increased levels of molecules or ions capable of donating a hydron (proton or hydrogen ion) to other chemical entities, or, alternatively, capable of forming covalent bonds with other chemicals via the acceptance of an electron pair, resulting in a bulk pH measurement of less than 7." .

:acidic rdfs:label "acidic" .

:has_quality rdfs:label "has quality" .

:soil rdfs:label "soil" .

,"Acidic soil is conceptually the same as soil with certain intersectional properties. It shares a defining quality of having an acidic nature. Interesting, acidic soil is not just a different type of soil, but it is also a subclass of soil with certain distinct features.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acidic_volcanic_ash rdfs:label "acidic volcanic ash" ;
    rdfs:subClassOf [ owl:onProperty :has_quality ;
            owl:someValuesFrom :acidic ],
        :volcanic_ash ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :volcanic_ash ;
                    rdf:rest [ rdf:first [ owl:onProperty :has_quality ;
                                    owl:someValuesFrom :acidic ] ] ] ] ;
    :has_definition "Volcanic ash which has increased levels of molecules or ions capable of donating a hydron (proton or hydrogen ion) to other chemical entities, or, alternatively, capable of forming covalent bonds with other chemicals via the acceptance of an electron pair, resulting in a bulk pH measurement of less than 7." .

:acidic rdfs:label "acidic" .

:has_quality rdfs:label "has quality" .

:volcanic_ash rdfs:label "volcanic ash" .

,"Acidic volcanic ash shares the same concept and intersects with volcanic ash. There's an intersection between the quality of acidic volcanic ash and the property 'has quality'. Furthermore, this concept also intersects with and shares values from 'acidic'.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:holothurian_digestive_tract rdfs:label "holothurian digestive tract" ;
    rdfs:subClassOf [ owl:onProperty :part_of ;
            owl:someValuesFrom :holothuroidea ],
        :digestive_tract,
        :environment_associated_with_an_animal_part_or_small_animal ;
    :has_broad_synonym "sea cucumber gut" ;
    :has_definition "A digestive tract environment which has its properties and dynamics determined by the digestive tract of an echinoderm from the class Holothuroidea." ;
    :has_exact_synonym "sea cucumber digestive tract" .

:digestive_tract rdfs:label "digestive tract" .

:environment_associated_with_an_animal_part_or_small_animal rdfs:label "environment associated with an animal part or small animal" .

:holothuroidea rdfs:label "Holothuroidea" .

:part_of rdfs:label "part of" .

,"The holothurian digestive tract is a subclass of the environment associated with an animal part or a small animal, as well as being a subclass of the digestive tract. Within this hierarchy, the holothurian digestive tract is also identified as a subclass on the property of being a part of something, with some values deriving from the class Holothuroidea. All of these elements contribute to the digestive tract's overall definition: a digestive tract environment where both its properties and dynamics are determined by the digestive tract of an echinoderm from the class Holothuroidea. In broader, more colloquial terms, the holothurian digestive tract is also synonymous with ""sea cucumber gut"". Additionally, this term has a precise synonym, ""sea cucumber digestive tract""."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:holothurian_digestive_tract_contents rdfs:label "holothurian digestive tract contents" ;
    rdfs:subClassOf [ owl:onProperty :located_in ;
            owl:someValuesFrom :holothurian_digestive_tract ],
        :bodily_fluid ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :bodily_fluid ;
                    rdf:rest [ rdf:first [ owl:onProperty :located_in ;
                                    owl:someValuesFrom :holothurian_digestive_tract ] ] ] ] ;
    :has_definition "A bodily fluid which is present in the digestive tract of a member of the Holothuroidea." .

:bodily_fluid rdfs:label "bodily fluid" .

:holothurian_digestive_tract rdfs:label "holothurian digestive tract" .

:located_in rdfs:label "located in" .

,"The term ""holothurian digestive tract contents"" is conceptually the same as the intersection of ""bodily fluid"" with the properties of being located in and having some values from the ""holothurian digestive tract"". Additionally, ""holothurian digestive tract contents"" can also be considered as a subclass of ""bodily fluid"". This term describes a unique subcategory of bodily fluid that is located in and derives some of its properties from the holothurian digestive tract. This definition further explicates the term as a kind of bodily fluid found in the digestive tract of an organism belonging to the Holothuroidea class."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:algal_material rdfs:label "algal material" ;
    rdfs:subClassOf :organic_material .

:organic_material rdfs:label "organic material" .

,Algal material is a sub-class of organic material.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brown_sea_ice rdfs:label "brown sea ice" ;
    rdfs:subClassOf [ owl:onProperty :has_quality ;
            owl:someValuesFrom :brown ],
        :sea_ice ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :sea_ice ;
                    rdf:rest [ rdf:first [ owl:onProperty :has_quality ;
                                    owl:someValuesFrom :brown ] ] ] ] ;
    :has_definition "Sea ice which has a brown colouration, either due to 1) the presence of pigments which are or were contained in the members of ecological assemblages, such as algal communities, living or trapped within the ice or 2) due to the presence of trapped sediments." ;
    :has_exact_synonym "brownish colored sea ice" .

:brown rdfs:label "brown" .

:has_quality rdfs:label "has quality" .

:sea_ice rdfs:label "sea ice" .

,"Brown sea ice and sea ice are fundamentally the same in concept, intersecting in their shared qualities. They share an intrinsic characteristic, which is brown in color. This is further highlighted when we talk about brown sea ice as a subclass of sea ice - this subclassification indicates the specific quality, again, of being brown. In addition, the brown sea ice class also illustrates how some of its values stem from being brown.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_surface rdfs:label "water surface" ;
    rdfs:subClassOf [ owl:onProperty :part_of ;
            owl:someValuesFrom :liquid_water ],
        :aquatic_layer,
        :liquid_surface_layer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :liquid_surface_layer ;
                    rdf:rest [ rdf:first [ owl:onProperty :part_of ;
                                    owl:someValuesFrom :liquid_water ] ] ] ] ;
    :has_definition "The surface layer of a volume of water." ;
    :has_exact_synonym "surface of a body of water",
        "water body surface" .

:aquatic_layer rdfs:label "aquatic layer" .

:liquid_surface_layer rdfs:label "liquid surface layer" .

:liquid_water rdfs:label "liquid water" .

:part_of rdfs:label "part of" .

,"The water surface shares the same concept as the intersection of the liquid surface layer. It is also related to two other categories, one is 'part of' and the other is 'some values from liquid water'. These two relations are shared by water surface by virtue of being integral components and characteristics of it, respectively. Furthermore, water surface is a sub class of the aquatic layer and liquid surface layer. Similarly, it forms a part of something and also takes some values from liquid water. The water surface is defined as the surface layer of a volume of water and is also exactly synonymous with the surface of a body of water or water body surface."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sediment_surface rdfs:label "sediment surface" ;
    rdfs:subClassOf [ owl:onProperty :part_of ;
            owl:someValuesFrom :sediment ],
        :surface_layer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :surface_layer ;
                    rdf:rest [ rdf:first [ owl:onProperty :part_of ;
                                    owl:someValuesFrom :sediment ] ] ] ] ;
    :has_definition "The surface layer of a mass of sediment." ;
    :has_exact_synonym "surface of a sedimentary mass",
        "surface sediment" .

:part_of rdfs:label "part of" .

:sediment rdfs:label "sediment" .

:surface_layer rdfs:label "surface layer" .

,"The sediment surface has a concept synonymous with the intersection of a surface layer. It is also part of something, relating to the intersection of certain object properties, as well as possessing certain values from the sediment. Moreover, the sediment surface is a subclass of the surface layer and is a part of something, while also retaining some attributes from the sediment. The sediment surface is defined as the surface layer of a mass of sediment. It also goes by other names such as the surface of a sedimentary mass and surface sediment."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_based_planetary_surface rdfs:label "water-based planetary surface" ;
    rdfs:subClassOf [ owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :water_surface ;
                            rdf:rest [ rdf:first [ owl:onProperty :adjacent_to ;
                                            owl:someValuesFrom [ ] ] ] ] ] ],
        :aquatic_layer,
        :liquid_planetary_surface,
        :liquid_surface_layer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :liquid_planetary_surface ;
                    rdf:rest [ rdf:first [ owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :liquid_water ] ] ] ] ;
    :has_related_synonym "A liquid planetary surface which is composed primarily of water." .

:adjacent_to rdfs:label "adjacent to" .

:aquatic_layer rdfs:label "aquatic layer" .

:composed_primarily_of rdfs:label "composed primarily of" .

:has_part rdfs:label "has part" .

:liquid_surface_layer rdfs:label "liquid surface layer" .

:liquid_water rdfs:label "liquid water" .

:water_surface rdfs:label "water surface" .

:liquid_planetary_surface rdfs:label "liquid planetary surface" .

,"A water-based planetary surface shares the same concept as an intersection of a liquid planetary surface. Furthermore, this concept is similar to an intersection of composed primarily of and it also shares similarities with an intersection of some values from liquid water.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:magnetosphere rdfs:label "magnetosphere" ;
    rdfs:subClassOf [ owl:onProperty :contains ;
            owl:someValuesFrom :astronomical_body ],
        [ owl:onProperty :overlaps ;
            owl:someValuesFrom :outer_space ],
        [ owl:onProperty :has_disposition ;
            owl:someValuesFrom :cosmic_ray_shielding_disposition ],
        :environmental_zone ;
    :has_definition "A site in which charged particles are influenced by an astronomical body's magnetic field." .

:astronomical_body rdfs:label "astronomical body" .

:contains rdfs:label "contains" .

:cosmic_ray_shielding_disposition rdfs:label "cosmic ray shielding disposition" .

:environmental_zone rdfs:label "environmental zone" .

:has_disposition rdfs:label "has disposition" .

:outer_space rdfs:label "outer space" .

:overlaps rdfs:label "overlaps" .

,"The magnetosphere is a subclass of environmental zone. This definition is further depicted by various relationships. It has the disposition of providing cosmic ray shielding, which is one of its properties. Another property of a magnetosphere is that it contains an astronomical body. Furthermore, it also overlaps with outer space. In a more detailed description, a magnetosphere is defined as a site in which charged particles are influenced by an astronomical body's magnetic field."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:radiation_shielding_disposition rdfs:label "radiation shielding disposition" ;
    rdfs:subClassOf :environmental_disposition ;
    :has_definition "An environmental disposition which inheres in an entity that intercepts, attenuates, or blocks radiation." .

:environmental_disposition rdfs:label "environmental disposition" .

,"Radiation shielding disposition is a subclass of environmental disposition. This implies that radiation shielding disposition is a kind of environmental disposition. Additionally, radiation shielding disposition is defined as an environmental disposition which inheres in an entity that intercepts, attenuates, or blocks radiation. This means that an entity with radiation shielding disposition has the ability to reduce or stop the impact of radiation."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cosmic_ray_shielding_disposition rdfs:label "cosmic ray shielding disposition" ;
    rdfs:subClassOf :radiation_shielding_disposition ;
    :has_definition "A radiation shielding disposition which inheres in a material or immaterial entity which attenuates or blocks cosmic rays." .

:radiation_shielding_disposition rdfs:label "radiation shielding disposition" .

,"Cosmic ray shielding disposition is a sub-class of radiation shielding disposition. It is defined as a radiation shielding disposition that resides in a material or non-material entity, and its function is to attenuate or block cosmic rays."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:induced_magnetosphere rdfs:label "induced magnetosphere" ;
    rdfs:subClassOf :magnetosphere ;
    :has_definition "A magnetosphere which either 1) cannot withstand the pressure of the stellar wind interacting with it, thus allowing the stellar wind to interact with the ionosphere, atmosphere, or surface of the planet generating it or 2) is formed by the interaction of the stellar wind with an astronomical body unshielded by its own magnetosphere." .

:magnetosphere rdfs:label "magnetosphere" .

,"An induced magnetosphere is a subclass of a magnetosphere. By definition, an induced magnetosphere is a type of magnetosphere that cannot withstand the pressure of the stellar wind interacting with it and thus, lets the stellar wind interact with the ionosphere, atmosphere, or surface of the planet generating it. Alternatively, an induced magnetosphere can also be formed by the interaction of the stellar wind with an astronomical body that does not have its own protective magnetosphere."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intrinsic_magnetosphere rdfs:label "intrinsic magnetosphere" ;
    rdfs:subClassOf :magnetosphere ;
    :has_definition "A magnetosphere which shields the body generating it from the stellar wind by withstanding the stellar wind's pressure before it reaches the body." .

:magnetosphere rdfs:label "magnetosphere" .

,An intrinsic magnetosphere is a subclass of magnetosphere. It is defined as a magnetosphere that shields the body generating it from the stellar wind by withstanding the stellar wind's pressure before it reaches the body.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:terrestrial_environmental_zone rdfs:label "terrestrial environmental zone" ;
    rdfs:subClassOf [ owl:onProperty :part_of ;
            owl:someValuesFrom :terrestrial_biome ],
        [ owl:onProperty :part_of ;
            owl:someValuesFrom :planetary_landmass ],
        :environmental_zone ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_zone ;
                    rdf:rest [ rdf:first [ owl:onProperty :part_of ;
                                    owl:someValuesFrom :planetary_landmass ] ] ] ] ;
    :has_definition "An environmental zone which is bounded by material parts of a land mass or the atmosphere or space adjacent to it." .

:terrestrial_biome rdfs:label "terrestrial biome" .

:environmental_zone rdfs:label "environmental zone" .

:planetary_landmass rdfs:label "planetary landmass" .

:part_of rdfs:label "part of" .

,"A terrestrial environmental zone shares a concept similarity with an environmental zone. There's an intersection between the two, with the terrestrial environmental zone being a part of an environmental zone and some values correlating with a planetary landmass.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anthropised_terrestrial_environmental_zone rdfs:label "anthropised terrestrial environmental zone" ;
    rdfs:subClassOf [ owl:onProperty :part_of ;
            owl:someValuesFrom :anthropogenic_terrestrial_biome ],
        :terrestrial_environmental_zone ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :terrestrial_environmental_zone ;
                    rdf:rest [ rdf:first [ owl:onProperty :part_of ;
                                    owl:someValuesFrom :anthropogenic_terrestrial_biome ] ] ] ] ;
    :has_definition "A terrestrial zone which is bounded by constructed, manufactured, or other anthropogenic material entities." .

:anthropogenic_terrestrial_biome rdfs:label "anthropogenic terrestrial biome" .

:part_of rdfs:label "part of" .

:terrestrial_environmental_zone rdfs:label "terrestrial environmental zone" .

,"The anthropised terrestrial environmental zone shares the same concept as and is an intersection of the terrestrial environmental zone. This zone is a part of something, thus proving its property, and has a significant overlap with some values from the anthropogenic terrestrial biome, suggesting a complex intertwining linkage. Moreover, the anthropised terrestrial environmental zone is a sub-class of the terrestrial environmental zone. It obeys the property of forming a part of something else and shares some values from the broader category of the anthropogenic terrestrial biome. Additionally, the anthropised terrestrial environmental zone is defined as a terrestrial zone which is bounded by constructed, manufactured, or other anthropogenic material entities. Thus, it has a significant presence in the environment as a whole."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marine_environmental_zone rdfs:label "marine environmental zone" ;
    rdfs:subClassOf [ owl:onProperty :part_of ;
            owl:someValuesFrom :marine_environment ],
        :environmental_zone ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_zone ;
                    rdf:rest [ rdf:first [ owl:onProperty :part_of ;
                                    owl:someValuesFrom :marine_environment ] ] ] ] ;
    :has_definition "An environmental zone which is bounded by material parts of a marine environment." .

:environmental_zone rdfs:label "environmental zone" .

:marine_environment rdfs:label "marine environment" .

:part_of rdfs:label "part of" .

,"The marine environmental zone is a concept that intersects with the environmental zone, indicating they share similar characteristics. Within this, the marine environmental zone is also in part a component of other intersecting concepts. One being that it is part of something greater, and the other being having some values from the marine environment. Furthermore, the marine environmental zone is a sub-class of the environmental zone, implying its properties are derived from this broader class. It is also classified based on two properties: it forms part of a larger entity and draws some values from the marine environment. Lastly, the marine environmental zone is defined as an environmental zone which is bounded by material parts of a marine environment."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alluvium rdfs:label "alluvium" ;
    rdfs:subClassOf [ owl:onProperty :has_quality ;
            owl:someValuesFrom :granular ],
        [ owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :alluvial_soil ;
                            rdf:rest [ rdf:first :alluvial_sediment ] ] ] ],
        [ owl:onProperty :has_quality ;
            owl:someValuesFrom :porous ],
        :environmental_material ;
    :has_definition "Soil or sediment which has been eroded and influenced by flowing water and redeposited in a non-marine setting." .

:alluvial_sediment rdfs:label "alluvial sediment" .

:alluvial_soil rdfs:label "alluvial soil" .

:composed_primarily_of rdfs:label "composed primarily of" .

:environmental_material rdfs:label "environmental material" .

:granular rdfs:label "granular" .

:porous rdfs:label "porous" .

:has_quality rdfs:label "has quality" .

,"Alluvium is a subclass of environmental material. It has multiple properties and qualities. Firstly, alluvium is defined by having the quality of being porous. Secondly, it also has the distinctive quality of being granular. The primary composition of alluvium is made up of a union between alluvial soil and alluvial sediment. Lastly, to define it, alluvium is soil or sediment that has undergone erosion due to the influence of flowing water and has been redeposited in a non-marine environment."

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alluvial_sediment rdfs:label "alluvial sediment" ;
    rdfs:subClassOf :sediment ;
    :has_definition "Sediment which has been transported by flowing water and redeposited in a non-marine setting." .

:sediment rdfs:label "sediment" .

,Alluvial sediment is a subclass of sediment. It is defined as sediment that has been transported by flowing water and redeposited in a non-marine setting.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alluvial_deposit rdfs:label "alluvial deposit" ;
    rdfs:subClassOf [ owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :alluvial_soil ;
                            rdf:rest [ rdf:first :alluvial_sediment ] ] ] ],
        [ owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :lithification ],
        :rock ;
    :has_definition "A rock which is formed as a result of the lithification of alluvium." .

:alluvial_sediment rdfs:label "alluvial sediment" .

:alluvial_soil rdfs:label "alluvial soil" .

:composed_primarily_of rdfs:label "composed primarily of" .

:formed_as_result_of rdfs:label "formed as result of" .

:lithification rdfs:label "lithification" .

:rock rdfs:label "rock" .

,"Alluvial deposit is a sub-class of rock. It is formed as a result of a specific process and is primarily composed of certain materials. The process that forms it is called lithification. In terms of composition, it encompasses a number of elements. Specifically, it includes alluvial soil, but it also includes a wider range of elements defined under alluvial sediment. By definition, an alluvial deposit is a rock which is formed as a result of the lithification of alluvium."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lithification rdfs:label "lithification" ;
    rdfs:subClassOf [ owl:onProperty :has_input ;
            owl:someValuesFrom :sediment ],
        [ owl:onProperty :results_in_formation_of ;
            owl:someValuesFrom :sedimentary_rock ],
        :biological_process,
        :material_transformation_process ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :material_transformation_process ;
                    rdf:rest [ rdf:first [ owl:onProperty :has_input ;
                                    owl:someValuesFrom :sediment ] ;
                            rdf:rest [ rdf:first [ owl:onProperty :results_in_formation_of ;
                                            owl:someValuesFrom :sedimentary_rock ] ] ] ] ] ;
    :has_definition "A process during which sediments compact under pressure, expel connate fluids, and gradually become solid sedimentary rock." .

:biological_process rdfs:label "biological_process" .

:has_input rdfs:label "has input" .

:material_transformation_process rdfs:label "material transformation process" .

:results_in_formation_of rdfs:label "results in formation of" .

:sediment rdfs:label "sediment" .

:sedimentary_rock rdfs:label "sedimentary rock" .

,"Lithification, a complex term, can be understood in terms of various relations and roles it plays. At the core, lithification shares a concept with the intersection of a material transformation process

@prefix : <https://zaitoun.dev/onto/> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:grassland_ecosystem rdfs:label "grassland ecosystem" ;
    rdfs:subClassOf :terrestrial_ecosystem ;
    :has_definition "An ecosystem in which grasses (Graminae) are the dominant form of vegetation and determine the system's structure and dynamics."^^xsd:string ;
    :has_exact_synonym "GRASSLAND"^^xsd:string,
        "grassland"^^xsd:string ;
    :has_related_synonym "Grassland"^^xsd:string,
        "down"^^xsd:string,
        "downland"^^xsd:string,
        "downs"^^xsd:string,
        "glade"^^xsd:string,
        "grazing area"^^xsd:string,
        "herbaceous area"^^xsd:string .

:terrestrial_ecosystem rdfs:label "terrestrial ecosystem" .

,"The grassland ecosystem is a sub class of the terrestrial ecosystem. Its definition states that it is an ecosystem in which grasses (Graminae) are the dominant form of vegetation and determine the system's structure and dynamics. The term ""grassland ecosystem"" has exact synonyms, specifically, ""grassland"" and ""GRASSLAND"". Additionally, the term has several related synonyms such as ""Grassland"", ""down"", ""downland"", ""downs"", ""glade"", ""grazing area"", and ""herbaceous area""."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ranch rdfs:label "ranch" ;
    rdfs:subClassOf [ owl:onProperty :part_of ;
            owl:someValuesFrom :rangeland_biome ],
        :farm ;
    :has_definition "An area of land used for the herding and grazing of livestock."^^xsd:string ;
    :has_related_synonym "ranch"^^xsd:string .

:farm rdfs:label "farm" .

:part_of rdfs:label "part of" .

:rangeland_biome rdfs:label "rangeland biome" .

,"A ranch is a subclass of a farm. There are other characteristics that further define a ranch. It is on a property, which forms a part of its classification. Additionally, some of its values come from the rangeland biome. By definition, a ranch is an area of land used for the herding and grazing of livestock. The term ""ranch"" is also used synonymously to describe this type of land area."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:swamp_area rdfs:label "swamp area" ;
    rdfs:subClassOf [ owl:onProperty :overlaps ;
            owl:someValuesFrom :swamp_ecosystem ],
        :wetland_area ;
    :has_definition "An area of wetland which overlaps a swamp ecosystem."^^xsd:string .

:overlaps rdfs:label "overlaps" .

:swamp_ecosystem rdfs:label "swamp ecosystem" .

:wetland_area rdfs:label "wetland area" .

,"A swamp area is a subclass of the wetland area. This swamp area also possesses a property that overlaps, and it derives some of its values from the swamp ecosystem. Besides, the swamp area is defined as an area of wetland which overlaps a swamp ecosystem."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:defence_against_flooding rdfs:label "defence against flooding" ;
    rdfs:subClassOf [ owl:onProperty :negatively_regulates ;
            owl:someValuesFrom :flooding ],
        :anthropogenic_modulatory_intervention_process ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :anthropogenic_modulatory_intervention_process ;
                    rdf:rest [ rdf:first [ owl:onProperty :negatively_regulates ;
                                    owl:someValuesFrom :flooding ] ] ] ] ;
    :has_definition "A planned process during which an environmental system is modified to mitigate or nullify the impacts of flooding." ;
    :has_exact_synonym "defense against flooding" ;
    :has_related_synonym "defence against floods",
        "defense against floods",
        "flood defence",
        "flood defence intervention",
        "flood defense",
        "flood defense intervention" .

:anthropogenic_modulatory_intervention_process rdfs:label "anthropogenic modulatory intervention process" .

:flooding rdfs:label "flooding" .

:negatively_regulates rdfs:label "negatively regulates" .

,"Defence against flooding shares the same concept as the intersection of the anthropogenic modulatory intervention process. This intersections also reflects that it negatively regulates some values from flooding. It is therefore understood that the primary motive of the defence against flooding is to negatively regulate the impacts of flooding.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stellar_radiation rdfs:label "stellar radiation" ;
    rdfs:subClassOf [ owl:onProperty :process_has_causal_agent ;
            owl:someValuesFrom :star ],
        :electromagnetic_radiation ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :electromagnetic_radiation ;
                    rdf:rest [ rdf:first [ owl:onProperty :process_has_causal_agent ;
                                    owl:someValuesFrom :star ] ] ] ] ;
    :has_definition "An electromagnetic radiation process during which electromagnetic waves or their quanta are emitted from a star." ;
    :has_narrow_synonym "solar radiation" .

:electromagnetic_radiation rdfs:label "electromagnetic radiation" .

:process_has_causal_agent rdfs:label "process has causal agent" .

:star rdfs:label "star" .

,"Stellar radiation shares the same concept as electromagnetic radiation and intersects within the property of 'process has causal agent'. Additionally, stellar radiation shares this same concept with an intersection from 'some values from star'. The stellar radiation is also a subset of electromagnetic radiation and abides by the property that the 'process has causal agent'. Stellar radiation is also a subset of the value derived from the star. Stellar radiation is defined as an electromagnetic radiation process during which electromagnetic waves or their quanta are emitted from a star. Moreover, stellar radiation is synonymously known as solar radiation."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:microwave_stellar_radiation rdfs:label "microwave stellar radiation" ;
