        :stellar_radiation ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :microwave_radiation ;
                    rdf:rest [ rdf:first [ owl:onProperty :process_has_causal_agent ;
                                    owl:someValuesFrom :star ] ] ] ] ;
    :has_definition "A stellar radiation process during which electromagnetic waves or their quanta are emitted from a star at wavelengths and frequencies which travel exclusively in a line-of-sight fashion and which may produce molecular rotation and torsion on contact with matter." ;
    :has_narrow_synonym "microwave solar radiation" .

:process_has_causal_agent rdfs:label "process has causal agent" .

:star rdfs:label "star" .

:stellar_radiation rdfs:label "stellar radiation" .

:microwave_radiation rdfs:label "microwave radiation" .

,"Microwave stellar radiation has the same concept features as the intersection of microwave radiation. Within this concept, microwave stellar radiation shares similar attributes with the intersection of the process has causal agent, as well as some values from a star. Moreover, microwave stellar radiation is considered a subclass of both stellar radiation and microwave radiation.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:radio_wave_stellar_radiation rdfs:label "radio wave stellar radiation" ;
    rdfs:subClassOf :radio_wave_radiation,
        :stellar_radiation ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :radio_wave_radiation ;
                    rdf:rest [ rdf:first [ owl:onProperty :process_has_causal_agent ;
                                    owl:someValuesFrom :star ] ] ] ] ;
    :has_definition "A stellar radiation process during which electromagnetic waves or their quanta are emitted from a star at wavelengths ranging from millimetre to kilometer scales." ;
    :has_narrow_synonym "radio wave solar radiation" .

:process_has_causal_agent rdfs:label "process has causal agent" .

:star rdfs:label "star" .

:stellar_radiation rdfs:label "stellar radiation" .

:radio_wave_radiation rdfs:label "radio wave radiation" .

,"Radio wave stellar radiation shares a concept similarity with the intersection of radio wave radiation. This intersection also extends to two aspects: it is causally linked to a certain process, and it also holds some values from a star. Furthermore, radio wave stellar radiation is a subclass of both stellar radiation and radio wave radiation. Defined as a stellar radiation process, radio wave stellar radiation is when electromagnetic waves or their particles are emitted from a star at wavelengths ranging from millimeter to kilometer scales. Interestingly, it also has a narrow synonym known as radio wave solar radiation."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
