                                    owl:someValuesFrom :star ] ] ] ] ;
    :has_broad_synonym "infrared radiation" ;
    :has_definition "A stellar radiation process during which electromagnetic waves or their quanta are emitted from a star when molecules change their rotational-vibrational movements, usually at wavelengths between 760 nm and 1 mm." ;
    :has_exact_synonym "infra-red stellar radiation" ;
    :has_narrow_synonym "infrared solar radiation" ;
    :has_related_synonym "IR stellar radiation" .

:process_has_causal_agent rdfs:label "process has causal agent" .

:star rdfs:label "star" .

:stellar_radiation rdfs:label "stellar radiation" .

:infrared_radiation rdfs:label "infrared radiation" .

,"Infrared stellar radiation, conceptually the same as the intersection of infrared radiation, has a sub-class relationship with both stellar radiation and infrared radiation itself. This concept also intersects with the property of 'process has causal agent' and some values from 'star'.

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
