:process_has_causal_agent rdfs:label "process has causal agent" .

:star rdfs:label "star" .

:stellar_radiation rdfs:label "stellar radiation" .

:visible_spectrum_radiation rdfs:label "visible spectrum radiation" .

,"Visible spectrum stellar radiation holds the same concept as the intersection of visible spectrum radiation. Further, it is identical to the intersection of process has a causal agent and some values from the star. Also, visible spectrum stellar radiation is a sub-category of both stellar radiation and visible spectrum radiation. It is defined as a stellar radiation process during which electromagnetic waves or their quanta are emitted from a star at wavelengths between 380 nm and 760 nm. Additionally, it is precisely synonymous with optical stellar radiation and narrowly synonymous with visible spectrum solar radiation."

@prefix : <https://zaitoun.dev/onto/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
